import React, { useState } from 'react';
import axios from 'axios';

export function Navbar() {

    return(
        <div style={{display: 'flex', justifyContent: 'space-between', paddingBottom: '20px', paddingTop: '20px', backgroundColor: 'aliceblue'}}>
            <column style={{marginLeft: '50px', marginRight: '20px'}}>
                Notes
            </column>
            <input type='text' style={{marginLeft: '20px'}}/>
            <text style={{marginRight: '50px', backgroundColor: 'red', padding: '8px', paddingTop: '4px', borderRadius: 'px'}}>Sign In</text>
        </div>
    );
}
